'General configuration of your signup form. Write the Terms & Conditions of your affiliate program, choose if to display payout option and what to do after signup.'=>'Configurare generala a formularului dumneavoastra de inscriere. Scrieti Termeni si Conditii ai programului de afiliat, alegeti daca sa fie afisata optiunea de plata si ce sa faceti dupa inscriere.',
