'If you don\'t want to use the standard signup form, you can use pure HTML signup form. Just copy & paste the code below to a HTML page and you have fully customizable signup form.'=>'Daca nu doresti sa utilizezi formularul de inscriere standard, poti folosi formularul pentru inscriere HTML. Doar fa copy & paste codul de mai jos la o paginÄ HTML si vei avea formularul de inscriere complet personalizabil.',
'Debugging can be used for troubleshooting. If you turn it on, the system will log every action to your History log. You can use these messages to investigate the flow of commands, and to find out what is wrong. This way you can check what are the scripts doing and where exactly they fail. In production it should be turned off, because it generates multiple history records for each transaction and slows down the system.'=>'Debugging-ul poate fi folosit pentru rezolvarea problemelor. Daca il activezi sistemul va inregistra fiecare actiune a ta la History. Poti folosi aceste mesaje pentru a investiga fluxul de comenzi, precum si pentru a afla ce este gresit. In acest fel poti verifica in ce stadiu se afla  script-urile si unde se afla greseala. In productie ar trebui sa fie oprit, deoarece aceasta genereaza mai multe inregistrari pentru fiecare tranzacie incetinind sistemul.',
