'Action commissions'=>'Actiune comisioane',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Functia "Comisioane actiuni" permite definireacomisioanelor per actiune sau per "orice".<br/>Astfel se pot defini comisioane  per inregistrarile userilor, per descarcare, per vizitarea  unei anumite pagini , etc..<br/><a href="%s" target="_blank">Mai multe informatii in Knowledge Base</a>',
'More help in our Knowledge Base'=>'More help in our Knowledge Base',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Rotatorul banner-ului este un tip special de banner care invarte alte bannere.<br/>Cand afiliatul introduce rotatorul in aceasta pagina, acesta afiseaza bannere care ii sunt transferate astfel incat vizitatorul sa vada de fiecare data cand viziteaza pagina afiliatului un alt banner.Banner rotator is a special type of banner that rotates other banners.<br/><a href="%s" target="_blank">Mai multe informatii in Knowledge Base</a>',
'Branding free'=>'Branding liber',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Branding Free este o trasatura speciala care permite schimbarea linkurilor in footer-ul panoului si formularul de la "Sustinut de %s" in propriul text si link.<br/><a href="%s" target="_blank">Mai multe informatii in Knowledge Base</a> ',
'Commission Groups'=>'Grupuri de comisioane',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Grupurile de comisioane permite setarea de comisioane diferite pentru useri diferiti in aceasi campanie.<br/><a href="%s" target="_blank">Mai multe informatii in Knowledge Base</a>',
'CPM commissions'=>'Comisioane CPM ',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'"Comisioan CPM" (cost per mia de afisari) sunt un tip special de comisioane care sunt rasplatite pentru 1000 de impresii, ceea ce inseamna afisarea bannerului de 10000 de ori.<br/><a href="%s" target="_blank">Mai multe informatii in  Knowledge Base</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Matricea fortata permite limitarea numarului de referrals ai subafiliatilor la care orice afiliat se poate referi. Asta inseamna ca fiecare afiliat poate avea numai un numar specificat de "copii. <a href="%s" target="_blank">Pentru mai multe detalii citeste  Knowledge Base</a>',
'Hosting of %s on  %s servers.'=>'hosting-ul of %s pe  %s servere.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'"Valute multiple" permite urmarirea vanzarilor in mai multe valute.<br/><a href="%s" target="_blank">Mai multe informatii in "Baza de cnostinte"</a>',
'Multiple merchants'=>'Multiple merchants',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'In mod implicit, toate campaniile in %s sunt publice, ceea ce inseamna ca toti afiliatii le pot vedea si promova. Caracteristica "Campanii private" iti permite sa creezi campanii private, ce vor fi vizibile numai afiliatilor selectati.<br/><a href="%s" target="_blank">Mai multe informatii in  Knowledge Base</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Iti permite crearea unui tip special de materiale promotionale - e-books rebranduite. Poti crea e-book PDF-ul numai o singura data si sa-l incarci la %s.Afiliatii tai vor primi automat o copie a cartii , cu numele lor, linkuri afiliatului, texte, etc.Nu este nevoie sa rulati nici-un program Windows pentru rebrandinging, pur si simplu vor descarca PDF-ul rebranduit. Tot rebranding-ul este realizat automat in fundal.<br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Comisioanele recurente permit recompensarea filiatilor dumneavoastra pentru platile periodice, de exemplu pentru hosting sau parteneriat. <br/> <a href="%s" target="_blank">Pentru mai multe informatii accesati Knowledge Base</a>',
