'Plugin will add to menu Tools new item "Database status", under which you can view database tables of %s. Information about database tables includes e.g. table names, table size, number of rows in each table. You can execute on tables database operations like Analyze table, Optimize table or Repair table. After activation of this plugin you need to reload application in browser to see changes in menu!'=>'Plugin-ul va adauga la "Unelte" din meniu un element nou "Status baza de date" in care se pot vedea tabelele bazei de date ale %s. Informatia despre tabelele bazei de date include e.g. numele tabelelor, dimensiunea, numar de randuri in fiecare tabel.Poti interveni in operatii ale datei de baza a tabelului ca "Analizeaza tabel" ,"Optimizeaza tabel"  sau "Repara tabel" .Dupa activarea acestui plugin trebuie sa reincarci aplicatia in browser pentru a vedea schimbari in meniu!',
