'Refid format'=>'Format Refid ',
'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Este posibila folosirea urmatoarelor valori in  ID: {9} - va fi inlocuit cu orice caracter intre [0-9], {z} - va fi inlocuit orice caracter intre [a-z], {Z} - va fi inlocuit orice caracter intre [A-Z], {X} - va fi inlocuit orice caracter intre [0-9a-zA-Z], toate celelate caractere vor fi copiate la refid in functie de specificatia din format. Exemplu de format bun este  e.g. {ZZZ}-{XXXXX}-{999}',
'Refid format saved'=>'Format Refid salvat',
